import { View, StyleSheet } from "react-native";

function App() {
  return (
      <>
        <View style={indexStyles.container}>
          <AppHeader />
           <WelcomeScreen />
          {/* <MenuItems /> */}
        </View>
        <View style={indexStyles.footerContainer}>
          <AppFooter />
        </View>
      </>
    );
  }

  const indexStyles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: "#AFEEEE",
    },
    footerContainer: {
      backgroundColor: "#AFEEEE",
    },
  });


export default App;
